import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import './css/Navbar.css'; // Import the CSS file
import resumePdf from '../assets/JayeshResume.pdf'; // Import the resume PDF file



const Navbar = ({ isAuthenticated, onSignOut }) => {
  return (
    <motion.nav 
      className="navbar"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <motion.h1 
        className="logo"
        initial={{ x: -100 }}
        animate={{ x: 0 }}
        transition={{ type: 'spring', stiffness: 100 }}
      >
        <Link to="/">My Portfolio</Link>
      </motion.h1>
      <motion.ul 
        className="nav-links"
        initial={{ y: -20 }}
        animate={{ y: 0 }}
        transition={{ type: 'spring', stiffness: 50 }}
      >
        <motion.li whileHover={{ scale: 1.1 }}>
          <Link to="/coding-work">Coding Work</Link>
        </motion.li>
        <motion.li whileHover={{ scale: 1.1 }}>
          <Link to="/photographs">Photographs</Link>
        </motion.li>
        {isAuthenticated ? (
          <>
            <motion.li whileHover={{ scale: 1.1 }}>
              <Link to="/admin">Admin Panel</Link>
            </motion.li>
            <motion.li>
              <button onClick={onSignOut}>Sign Out</button>
            </motion.li>
          </>
        ) : (
          <motion.li whileHover={{ scale: 1.1 }}>
            <Link to="/sign-in">Sign In</Link>
          </motion.li>
        )}
        <motion.li whileHover={{ scale: 1.1 }}>
          <a href={resumePdf} download="JayeshResume.pdf">
            <motion.button 
              className="resume-download"
              whileHover={{ scale: 1.1, backgroundColor: "#ff8a7b" }}
              whileTap={{ scale: 0.95 }}
            >
              Download Resume
            </motion.button>
          </a>
        </motion.li>
      </motion.ul>
    </motion.nav>
  );
};

export default Navbar;
